import React from 'react'
import { Link } from "react-router-dom";
import './Home.css';
import uterusPic from '../assets/uterus-pic.png';

function Home() {
    return (
        <body class="page">
            <header>
                <h1>qUterus</h1>
                <h2>How well do you know the uterus?</h2>
            </header>
            <div class="content">
                <div class="uterus-graphic"><img className="bounce" id="uterus-pic" src={uterusPic} alt="Girl in a jacket"/></div>
                <p>Hi my name is Qutera! </p>
                <Link to="quiz">Click to view our quiz page</Link>
                <Link to="aiquiz">Click to view our aiquiz page</Link>
            </div>
        </body>
    );
}

export default Home;
